import React from 'react'
import MainWelcomePage from '../index'
import dynamic from 'next/dynamic'
let ol;

const NullOLComponent = dynamic(
    () => (Promise.resolve(ol || import('../../../ObjectLand.Kernel/dist/main').then(m => ol = m))).then(m => class extends React.Component{render(){return null}}),
    { ssr: false }
  );
  
export function getOL(){return ol}
export default class Desktop extends React.Component{
render(){return <div><NullOLComponent></NullOLComponent><ol-dialog><MainWelcomePage></MainWelcomePage></ol-dialog></div>}

}
